pragma solidity 0.8.9;

contract Authentication {

    uint public nbrUsers;

    struct User{
        address addressAccount;
        string password;
        string firstName;
        string familyName;
        string typeUser;
    }

    mapping(address => User) private users;

    modifier youCanSignUp() {
        require(users[msg.sender].addressAccount != msg.sender, "You're already signed up");
        _;
    }

    constructor () {
        nbrUsers = 0;
    }

    function signUp(string memory _password, string memory _firstName, string memory _familyName, string memory _typeUser)
    public youCanSignUp()
    returns (address, string memory, string memory, string memory) {
        users[msg.sender].addressAccount = msg.sender;
        users[msg.sender].password = _password;
        users[msg.sender].firstName = _firstName;
        users[msg.sender].familyName = _familyName;
        users[msg.sender].typeUser = _typeUser;
        return (msg.sender, _firstName, _familyName, _typeUser);
    }

}
